⚡️Зеленский обратился к украинцам.

• Президент объявил о призыве резервистов;
• Анонсирован саммит лидеров Украины, Германии и Турции;
• В Украине запустят программу экономического патриотизма, предусматривающую снижение налогов для бизнеса.

Основные требования Путина к украинским властям:

1. Признать "волеизъявление" людей в Севастополе и Крыму;
2. Украина не должна вступить в НАТО. Киевские власти должны сами отказаться от вступления;
3. Демилитаризация Украины.

Здравый смысл вышел из чата.
